import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

const container = document.getElementById('root'); // Assuming you have a root div in your index.html
const root = ReactDOM.createRoot(container); // Use createRoot instead of render
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
